import styled from "styled-components"

export default function Plano({ planos }) {
    console.log(planos)
    return (
        <>
        {planos.map((a) =>
            <BoxPlano key={a.id}>
            <IconImg>
                <img src={a.image} alt="img" />
            </IconImg>
            <Preco>
                <p>R${a.price}</p>
            </Preco>
        </BoxPlano>
        )
        }
        </>
    )
}

const BoxPlano = styled.div`
    width: 290px;
    height: 180px;
    margin: 0 auto;
    margin-bottom: 10px;
    display: flex;
    justify-content: center;
    border: 3px solid #7E7E7E;
    border-radius: 12px;
    cursor: pointer;
`
const IconImg = styled.div`
    width: 50%;
    padding: 2%;
    display: flex;
    align-items: center;
    justify-content: center;
    img{
    width: 120px;
    height: 95px;
    }
`
const Preco = styled.div`
    width: 50%;
    display: flex;
    align-items: center;
    justify-content: center;
    p{
    font-weight: 700;
    font-size: 24px;
    line-height: 28px;
    color: #FFFFFF;
    }
`
